import React, { Component } from "react";
import { Header, Container, Button } from "semantic-ui-react";
import { BrowserRouter as Route, Link } from "react-router-dom";

import Tabla from "./JornadasTabla";
import Agregar from "./JornadasAgregar";

class Jornadas extends Component {
  state = {};
  render() {
    return (
      <Container>
        <Header as="h1">Jornadas</Header>
        <Link to="/jornadas/Agregar">
          <Button>Add Jornada</Button>
        </Link>
        <Route path="/jornadas" component={Tabla} />
        <Route path="/jornadas/Agregar" component={Agregar} />
      </Container>
    );
  }
}

export default Jornadas;
